import React from 'react'
import {VStack } from "@chakra-ui/react";

const Signup = () => {
  return (
    <VStack spacing={4}>
      <Box h="40px" bg="yellow.200">
        1
      </Box>
      <Box h="40px" bg="tomato">
        2
      </Box>
      <Box h="40px" bg="pink.100">
        3
      </Box>
    </VStack>
  );
}

export default Signup
